import React from 'react'

function Card(props) {
  return (
    <>  
      <h1>{props.sName}</h1><br/>
      <p>{"*"} {props.sType} Avilable</p><br/>
      <p>{props.sLoc} &nbsp;&nbsp;</p><br/><hr/>
    </>
  )
}

export default Card
